import React from 'react';
import './App.css';
import Header from './header';
import AppMain from './appMain';

function App() {
  return (
    <div className="App">
      <Header/>
      <AppMain/>
      <footer className="icons">
                <a href="https://www.linkedin.com/in/TakatoCox/">
                <img className="linkedInIcon" alt="link" src="https://img.icons8.com/office/48/000000/linkedin.png"/>   
                </a>
                <a href="https://www.linkedin.com/in/TakatoCox/">
                <img className="linkedInIcon" alt="link" src="https://img.icons8.com/office/48/000000/linkedin.png"/>   
                </a>
        </footer>
    </div>
  );
}

export default App;
